    <div style={{ color: "yellow" }}>
      <h1 className="test">
        Test 컴포넌트 입니다
        <br />
        {Temp}
        {Arr.map((ele, idx) => {
          return (
            <div key={idx}>
              <p>{ele}</p>
              <p>{idx}</p>
            </div>
          );
        })}
      </h1>
    </div>
  );
}

export default Test;
